#!/bin/bash
# https://developers.docusign.com/docs/click-api/how-to/create-clickwraps/
# How to create a Clickwrap
#
# Check that we're in a bash shell
if [[ $SHELL != *"bash"* ]]; then
    echo "PROBLEM: Run these scripts from within the bash shell."
fi

# Step 1: Obtain your OAuth token
# Note: Substitute these values with your own
ACCESS_TOKEN=$(cat config/ds_access_token.txt)

# Set up variables for full code example
# Note: Substitute these values with your own
account_id=$(cat config/API_ACCOUNT_ID)

# Construct your API headers
declare -a Headers=('--header' "Authorization: Bearer ${ACCESS_TOKEN}"
    '--header' "Accept: application/json"
    '--header' "Content-Type: application/json")

# Step 3. Construct the request body
# Create a temporary file to store the JSON body
request_data=$(mktemp /tmp/request-cw-001.XXXXXX)
printf \
    '{
  "displaySettings": {
    "consentButtonText": "I Agree",
    "displayName": "Terms of Service",
    "downloadable": true,
    "format": "modal",
    "hasAccept": true,
    "mustRead": true,
    "mustView": true,
    "requireAccept": true,
    "size": "medium",
    "documentDisplay": "document"
  },
  "documents": [
    {
      "documentBase64": "",
      "documentName": "Terms of Service",
      "fileExtension": "pdf",
      "order": 0
    }
  ],
  "name": "Terms of Service",
  "requireReacceptance": true
}
' >$request_data

# Step 4. Call the Click API
# a) Make a POST call to the Clickwraps endpoint to create a Clickwrap for an account
# b) Display the JSON structure of the created Clickwrap
# Create a temporary file to store the response
response=$(mktemp /tmp/response-cw.XXXXXX)
Status=$(curl --request POST https://demo.docusign.net/clickapi/v1/accounts/${account_id}/clickwraps \
    "${Headers[@]}" \
    --data-binary @${request_data} \
    --output ${response})

# Obtain the Clickwrap ID from the JSON response
clickwrap_id=$(cat $response | grep clickwrapId | sed 's/ //g' | sed 's/.*\"clickwrapId\":\"//' | sed 's/\",.*//')

# Store the envelope_id into the config file
echo $clickwrap_id >config/CLICKWRAP_ID

echo ""
echo "Response:"
cat $response
echo ""

# Remove the temporary files
rm "$request_data"
rm "$response"
